import React from 'react'
import { Link } from 'react-router-dom';
function LandingPage() {

  const buttonStyle = {
    margin: '10px',
    padding: '10px 20px',
    height: '10vh',
    width: '200px',
    backgroundColor: 'black',
    border: '1px solid #ccc',
    borderRadius: '5px',
    cursor: 'pointer',
  };

  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', minHeight: '75vh' }}>
      <div>
        <button style={buttonStyle}><Link to={`/user-management`}>View Users</Link></button>
        <button style={buttonStyle}><Link to={`/user-management`}>Add Users</Link></button>
        <button style={buttonStyle}><Link to={`/user-management`}>Export to excel</Link></button>
        <button style={buttonStyle}>Export to pdf</button>
        <button style={buttonStyle}>Logout</button>
      </div>
    </div>
  );
};

export default LandingPage
